import React from 'react'

const UserNewAddressItem = () => {
    return (
        <div className='UserEditAddressItem'>
            <input placeholder='Exampile ... Home' />
            <input placeholder='Address' />
            <input placeholder='P' />
            <button>Save</button>
        </div>
    )
}

export default UserNewAddressItem
